create table tblApplicant(
    applicantSeq number primary key,
    name varchar2(30) not null,
	jumin varchar2(60) not null check (substr(jumin,7,1) = '-'),
    tel varchar2(60) not null,
    email varchar2(60) not null
);
create table tblApplicant as select * from tblMember where MEMBERSEQ between 14 and 200;
alter table tblApplicant rename column MEMBERSEQ to applicantSeq;
alter table tblApplicant modify (applicantSeq number primary key);

create sequence seqApplicant start with 201;


select max(APPLICANTSEQ) from tblApplicant;
select * from tblApplicant order by applicantSeq;




